import React,{useState,useEffect} from 'react';
import './App.css';
import { JsonToTable } from "react-json-to-table";
import Stopwatch from "./Stopwatch";
import "./styles.css";
import { makeStyles } from '@material-ui/core/styles';

function App() {



  const state = {
     fullname: 'User',
   }

   function stateChange(f) {
    const {name, value} = f.target;
    this.setState({
      [name]: value,
    });
  }


  const d = require('./activities.json')

  return (

<div className="App">
<label htmlFor="fullname"> Full Name: </label>
<input type="text" name="fullname" onChange={this.stateChange("james")} />
<h4> Greetings, {this.state.fullname}!</h4>
  <p className="Stopwatch">
      <h1 > Productivity Tracker </h1>
      <Stopwatch />

  </p>

  <div className="Table" style={{display: "flex",justifyContent: "center",
    alignItems: "center", backgroundColor: "#E0E0E0"}}>

    <JsonToTable json={d['activities']}/>

  </div>

</div>



  );
}

export default App;
